  `qq` varchar(50) NOT NULL DEFAULT '',
  `email` varchar(50) NOT NULL DEFAULT '',
  `address` varchar(50) NOT NULL DEFAULT '',
  `message` text NOT NULL,
  `type` tinyint(3) NOT NULL COMMENT '区分不同表单',
